import React from 'react'
import styles from '../c_iphone-14-2.module.css';
import bg2 from "../assets2/bg2.png";
import card from "../assets2/card.png";
import grouptext1 from "../assets2/grouptext1.png";
import grouptext2 from "../assets2/grouptext2.png";

const Login = () => {
  return (
    <div className={styles['frame']}>
      <img
        src={bg2}
        alt="rectangle"
        width={390}
        height={844}
        className={styles['rectangle']}
      />
      <div className={styles['kotaklogin']}>
        <img
          src={card}
          alt="rectangle"
          width={390}
          height={521}
          className={styles['rectangle1']}
        />
        <img
          src={grouptext1}
          alt="rectangle"
          className={styles['rectangle2']}
        />
         <input type="text" name="" id="" className={styles['rectangle4']} />
         {/* <button className={styles['rectangle4']}>halo</button> */}
        <img
          src={grouptext2}
          alt="rectangle"
          className={styles['rectangle3']}
        />
      </div>
    </div>
  )
}

export default Login
